function EXAMPLE() {
  return new LanguageSupport(Ggplot2);
}

interface GgplotNode {
  type: string;
  from: number;
  to: number;
  children: GgplotNode[];
}

function treeToJSObject(cursor):GgplotNode {
  const node = cursor.node;
  const result = {
    type: node.type.name,
    from: node.from,
    to: node.to,
    children: [],
  };

  if (cursor.firstChild()) {
    do {
      result.children.push(treeToJSObject(cursor));
    } while (cursor.nextSibling());
    cursor.parent();
  }

  return result;
}

